// SearchComponent.jsx
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const PAGE_SIZE = 10;

function FindComponent() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [page, setPage] = useState(1);
  const [hasMore, setHasMore] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchResults = (searchTerm, pageNum = 1) => {
    if (!searchTerm.trim()) {
      setResults([]);
      setHasMore(false);
      return;
    }

    setLoading(true);
    setError(null);

    fetch(`http://127.0.0.1:5000/find/${pageNum}?search=${encodeURIComponent(searchTerm)}`)
      .then(res => res.json())
      .then(data => {
        if (data.error) {
          setError(data.error);
          setResults([]);
          setHasMore(false);
        } else {
          setResults(data.results);
          setPage(data.page);
          setHasMore(data.hasMore);
        }
      })
      .catch(err => {
        setError('Network error');
        setResults([]);
        setHasMore(false);
      })
      .finally(() => setLoading(false));
  };

  const handleSearch = (e) => {
    e.preventDefault();
    fetchResults(query, 1);
  };

  const goToPage = (newPage) => {
    fetchResults(query, newPage);
  };

  return (
    <div className="container py-5">
      <h2 className="mb-4 text-center">Full-Text Search</h2>

      <form className="d-flex mb-4" onSubmit={handleSearch}>
        <input
          type="text"
          className="form-control me-2"
          placeholder="Enter keyword..."
          value={query}
          onChange={e => setQuery(e.target.value)}
        />
        <button type="submit" className="btn btn-primary" disabled={loading}>
          {loading ? 'Searching...' : 'Search'}
        </button>
      </form>

      {error && <div className="alert alert-danger">{error}</div>}

      <div className="table-responsive">
        <table className="table table-striped">
          <thead>
            <tr>
              <th>Tournament</th>
              <th>Level</th>
              <th>Year</th>
              <th>Snippet</th>
            </tr>
          </thead>
          <tbody>
            {results.length > 0 ? (
              results.map((r, idx) => (
                <tr key={idx}>
                  <td>{r.tournament}</td>
                  <td>{r.level}</td>
                  <td>{r.year}</td>
                  <td>{r.snippet}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4" className="text-center py-4">
                  {loading ? 'Loading...' : 'No results' }
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>

      {results.length > 0 && (
        <div className="d-flex justify-content-between">
          <button
            className="btn btn-outline-secondary"
            onClick={() => goToPage(page - 1)}
            disabled={page === 1 || loading}
          >
            ← Previous
          </button>
          <span className="align-self-center">Page {page}</span>
          <button
            className="btn btn-outline-secondary"
            onClick={() => goToPage(page + 1)}
            disabled={!hasMore || loading}
          >
            Next →
          </button>
        </div>
      )}
    </div>
  );
}

export default FindComponent;
